import PropTypes from 'prop-types'

const Header = (props) => {
  return (
    <header>
        <h1>{props.title}</h1>
    </header>
  )
}

Header.defaultProps = {
    title: 'Username',
}

// can use the below to require properties/fix to variable types
Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
